import './Expenses.css';
function Expenses(props){
    return(
        <div className="expenses">
        <h2>Let's get started!</h2>
        
        <ExpenseItem title={
                expenseData[0].expenseTitle
            }
            amount={
                expenseData[0].amount
            }
            date={
                expenseData[0].date
            }
        ></ExpenseItem>
        <ExpenseItem title={
                expenseData[1].expenseTitle
            }
            amount={
                expenseData[1].amount
            }
            date={
                expenseData[1].date
        }></ExpenseItem>
        <ExpenseItem title={
                expenseData[2].expenseTitle
            }
            amount={
                expenseData[2].amount
            }
            date={
                expenseData[2].date
        }></ExpenseItem>
    </div>
    );
}

export default Expenses;
